    EmojiType(String emoji, String name, String category, Integer level) {
        this.category = category;
        this.emoji = emoji;
        this.name = name;
        this.level = level;
    }

    public static List<EmojiType> fromCategory(EmojiCategoryType category) {
        return Stream.of(values()) //
                .filter((e) -> e.getCategory() == category)
                .collect(Collectors.toList());
    }

    public String getEmoji() {
        return emoji;
    }

    public String getName() {
        return name;
    }

    public EmojiCategoryType getCategory() {
        return EmojiCategoryType.of(category);
    }

    public Integer getLevel() {
        return level;
    }
